      <h1 style={{ color: '#2563eb', marginBottom: '20px' }}>
        HarakaCare - Healthcare Management System
      </h1>
      <div style={{ 
        backgroundColor: '#f3f4f6', 
        padding: '20px', 
        borderRadius: '8px',
        marginBottom: '20px'
      }}>
        <h2>System Status: âœ… Working</h2>
        <p>The frontend is running successfully!</p>
      </div>
